import React from "react";
import classes from './DropdownCNFT.module.css';

function DropdownCNFT(props){

    return (
        <div className={classes.selectOptionsDiv}>
            <input className={classes.selectOptionsOption} checked={props.checked} type='radio' id={props.idDropdown} value={props.valueDropdown} />
            <p className={classes.selectOptionsText}>{props.textDropdown}</p>
        </div>
    ) 
}

export default DropdownCNFT;
